import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Srijan from './Srijan';
import Pdfcomp from './Pdfcomp';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Srijan />} />
        <Route path="/view-pdf" element={<Pdfcomp />} /> {/* Route for viewing the PDF */}
      </Routes>
    </Router>
  );
}

export default App;
